import React, { useState } from 'react';
import './InterviewSession.css';

function InterviewSession({ resumeFile, onBack }) {
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const [answers, setAnswers] = useState([]);
  const [currentAnswer, setCurrentAnswer] = useState('');
  const [finished, setFinished] = useState(false);

  const questions = [
    // Technical Questions
    { type: 'Technical', question: 'What are your core technical skills and expertise?' },
    { type: 'Technical', question: 'Describe a complex project you worked on and your role in it.' },
    { type: 'Technical', question: 'How do you approach problem-solving when faced with a challenging technical issue?' },
    { type: 'Technical', question: 'Tell me about your experience with version control and collaboration tools.' },
    // HR Questions
    { type: 'HR', question: 'Tell me about yourself and your career journey.' },
    { type: 'HR', question: 'Why are you interested in this position?' },
    { type: 'HR', question: 'How do you handle conflicts or disagreements with team members?' },
    { type: 'HR', question: 'Describe a time you failed and what you learned from it.' },
  ];

  const handleAnswerSubmit = () => {
    setAnswers([...answers, { question: questions[currentQuestionIndex].question, answer: currentAnswer }]);
    setCurrentAnswer('');
    if (currentQuestionIndex < questions.length - 1) {
      setCurrentQuestionIndex(currentQuestionIndex + 1);
    } else {
      setFinished(true);
    }
  };

  const handleSkip = () => {
    setAnswers([...answers, { question: questions[currentQuestionIndex].question, answer: 'Skipped' }]);
    setCurrentAnswer('');
    if (currentQuestionIndex < questions.length - 1) {
      setCurrentQuestionIndex(currentQuestionIndex + 1);
    } else {
      setFinished(true);
    }
  };

  if (finished) {
    return (
      <div className="interview-container">
        <div className="interview-complete">
          <h2>Interview Completed!</h2>
          <p>File: {resumeFile.name}</p>
          <p>Questions Answered: {answers.length} / {questions.length}</p>
          <div className="answers-summary">
            <h3>Your Responses:</h3>
            {answers.map((ans, idx) => (
              <div key={idx} className="answer-item">
                <p><strong>Q{idx + 1}: {ans.question}</strong></p>
                <p>{ans.answer || 'No answer provided'}</p>
              </div>
            ))}
          </div>
          <button onClick={onBack} className="btn btn-primary">Back to Dashboard</button>
        </div>
      </div>
    );
  }

  const currentQuestion = questions[currentQuestionIndex];
  const progress = ((currentQuestionIndex + 1) / questions.length) * 100;

  return (
    <div className="interview-container">
      <div className="interview-header">
        <h2>Interview Session</h2>
        <p>Resume: {resumeFile.name}</p>
      </div>

      <div className="progress-bar">
        <div className="progress" style={{ width: `${progress}%` }}></div>
      </div>
      <p className="progress-text">Question {currentQuestionIndex + 1} of {questions.length}</p>

      <div className="interview-content">
        <div className="question-box">
          <p className="question-type">{currentQuestion.type} Interview</p>
          <h3 className="question">{currentQuestion.question}</h3>
        </div>

        <div className="answer-box">
          <textarea
            value={currentAnswer}
            onChange={(e) => setCurrentAnswer(e.target.value)}
            placeholder="Type your answer here..."
            rows="6"
          />
        </div>

        <div className="button-group">
          <button onClick={handleSkip} className="btn btn-secondary">Skip</button>
          <button onClick={handleAnswerSubmit} className="btn btn-primary" disabled={!currentAnswer.trim()}>
            {currentQuestionIndex === questions.length - 1 ? 'Finish' : 'Next'}
          </button>
        </div>
      </div>
    </div>
  );
}

export default InterviewSession;
